import React from 'react';
import './App.css';
import Headers from './Headers'
import Article from './Article'
import Footer from './Footer'




function App (props) {
  return (
    <div className="container-fluid">
      <nav className="navbar navbar-expand-md navbar-dark bg-dark">

        <a className="navbar-brand" href="#"><i class="fas fa-hospital-user"></i>&nbsp;Sa√∫de e Mapeamento</a>

       <div className="collapse" id="navbarMainToggler">
          <div className="navbar-nav">
            <a className="nav-item nav-link" href="#">Inicio</a>
            <a className="nav-item nav-link" href="#">Dicas</a>
            <a className="nav-item nav-link" href="#">Feedback</a>
          </div>
        </div>
        
        

        <button className="navbar-toggler" type="button" data-toggle="collapse" data-target="#navbarMainToggler" aria-controls="navbarMainToggler" aria-expanded="false" aria-label="Toggle navigation">
          <span className="navbar-toggler-icon"></span>
        </button>

        </nav>


      </div>


    // <div>
    //         {/* <Headers /> */}
    //         {/* <Article />
    //         <Footer /> */}
    //       </div>
    
  );
};


export default App;
